import React, { Component } from "react";

class FooterHome extends Component {

render() {
        return (
             <React.Fragment>
            <hr/>
               <div>
                 <p style={{color: "red"}}>Desafio Front-End | API da Marvel e Google Maps|2021 by Michael Dydean</p>
               </div>
             </React.Fragment>
        );
    }
}

export default FooterHome;
